import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            To Do List
          </p>
        </header>
        <p>Enter a Task</p>
        <form>
          <input></input>
          <button type="submit">Add</button>
          </form>

      </div>
    );
  }
}

export default App;
